OS DEZ MANDAMENTOS DE HADDAD. Você tem que ler!!!

Fernando Haddad é autor do livro “Em Defesa do Socialismo”, publicado pela Editora Vozes em 1998. 

Vejam os dez mandamentos da doutrina comunista, ensinados pelo “Professor Haddad” em seu livro (páginas 14 e 15):

1o. Corrompa a juventude e dê-lhe liberdade sexual;

2o. Infiltre-se e depois controle todos os meios de comunicação;

3o. Divida a população em grupos antagônicos, incentivando as discussões sobre ações sociais;

4o. Destrua a confiança do povo em seus líderes;

5o. Colabore para a derrocada dos valores morais, da honestidade e da crença nas promessas dos governantes;

6o. Colabore com o esbanjamento de dinheiro público; coloque em descrédito a imagem do país, especialmente no exterior; provoque o pânico e desassossego na população e, por meio da infiltração, destrua a confiança do povo em seus líderes;

7o. Promova greves, mesmo ilegais, principalmente nas indústrias vitais no país;

8o. Promova distúrbios e contribua para que as autoridades constituídas não as coíbam;

9o. Procure catalogar todos aqueles que possuem armas de fogo para que sejam confiscadas no momento oportuno, objetivando dificultar ou impossibilitar qualquer resistência ou reação;

10o. Fale sempre em DEMOCRACIA e em estado de direito, mas, tão logo haja oportunidade, ASSUMA O PODER, SEM QUALQUER ESCRÚPULO.

[Letras maiúsculas e sublinhadas, pasmem, são do texto original do livro!]

