Eu tenho medo do genocídio de policiais e militares;

Eu tenho medo da inversão de valores numa sociedade doente e corrompida;

São tantos meus medos. Mas, o único que não me assusta, no momento, é o Bolsonaro, pq é o único que tem combatido com veemência a todos os meus medos. O resto, bem, o resto é sopa de letrinhas. "

