Testemunho altamente confiável do meu amigo Dante Mantovani! Muito obrigado pelo texto tão esclarecedor e desmistificador, meu amigo: 

Após ter acompanhado Jair Bolsonaro pelo interior de SP por quatro cidades (Presidente Prudente, Araçatuba, Glicério e São José do Rio Preto), divido com vocês o que percebi até aqui:

1-)ao contrário do estereótipo que a mídia criou e que impõe goela abaixo ao seu público, a personalidade de Jair Bolsonaro é tremendamente afável, simpática, calorosa e receptiva com todos à sua volta. Isto salta às vistas e é preciso ser muito desonesto para negá-lo.

2-) ao contrário do que certos ´intelectuais´ frustrados dizem, a equipe que o cerca é tremendamente capacitada, competente e patriota. Estão dando até a última gota de sangue pelo Jair, o que é outrossim evidente; 

3-)o apoio popular ao "mito" é uma coisa indescritível, uma energia tremenda toma conta das ruas por onde ele passa, como um gigante que desperta das profundezas da pátria, do morador de rua ao ruralista; do guarda municipal ao general de exército; do prefeito do interior ao gari; do vendedor ambulante ao aposentado, todos são unânimes - querem Jair Bolsonaro presidente do Brasil. Nasci no Interior de SP e morei a maior parte da minha vida nesta região e NUNCA vi nada parecido por aqui, e eu já participei de comícios de FHC, Lula e cia ltda e não senti nem 0,001% da energia que ora descrevo - o que qualquer um percebe, igualmente.

4-)minha simples presença, juntamente com a de meu amigo Paulo Eneas junto à comitiva de imprensa simplesmente inibiu a realização de perguntas idiotas sobre temas irrelevantes, vez que eu e o Paulo perguntamos sobre temas de verdadeiro interesse do povo brasileiro - e que por isso mesmo saltam às vistas -, sem a menor deferência aos grandes veículos de mídia, os quais ficaram bem comportadinhos em nossa presença. Extraímos disso uma forte recomendação a quem for entrevistar Jair Bolsonaro daqui em diante: jamais deixe a grande mídia sentir-se confortável em sua presença. E para quem é da grande mídia: aprenda a fazer perguntas decentes, caso contrário começarão a passar cada vez mais vergonha.

5-)As observações que os mesmos intelectuais que têm a bunda grudada na cadeira adoram fazer sobre o "amadorismo da campanha", consistem no fato de que a campanha não dispõe de recursos financeiros de fundos partidários e demais mordomias que os grandes saqueadores do Brasil ainda possuem. Ainda.

6-)A carga de afeto do povo ao MITO é brutal, mas também a carga de compromissos, eventos, convites, solicitações de toda espécie é avassaladora, o que exige uma força interior ímpar;

7-)Os candidatos (ao senado, deputado estadual, federal) que o cercam são em sua maioria muito bons, e em especial muito MELHORES do que qualquer petista, tucano ou comunista que saia por aí tendo a cara de pau de ainda pedir votos ao povo brasileiro, portanto, merecem todo nosso apoio. A menos, é claro, que vocês queiram comunistas que vão destruir o Brasil com muito mais rapidez entrando no Congresso Nacional;

8-)A coragem de Jair Bolsonaro em enfrentar tudo que tem enfrentado , com os poucos recursos que dispõe, na carga de exigências que esta missão quase suicida impõe, mostra que este cidadão é antes de tudo um grande PATRIOTA, que não tem nada, aboslutamente NADA de extremista e muito menos de despreparado. 

9-)Possuo graduação, especialização, mestrado, doutorado, vários cursos no exterior, livros publicados no Brasil e exterior e ao realizar diversas perguntas a Jair Bolsonaro aprendi muito com as respostas que ele me deu. Posso assegurar que quem o chama de despreparado é ele(a) próprio(a) despreparado(a);

Eu tenho certeza de que se o povo brasileiro continuar por este caminho que vi e testemunhei nas ruas, no tocante apoio à ÙNICA candidatura DECENTE e minimamente CAPACITADA para governar o Brasil, Deus permitirá que JAIR MESSIAS BOLSONARO seja o Presidente de TODOS os brasileiros a partir de 01 de janeiro de 2019.

