Principais propostas do Dep Federal *CAPITÃO DIÓGENES 1744*

1 – Compromete-se em manter vigilância ferrenha contra a aprovação de qualquer projeto de lei que afronte a família, a liberdade religiosa, os princípios cristãos, o direito de defesa e a propriedade privada, dos quais muitos já se encontram engatilhados aguardando votação, tais como: Legalização do Aborto; Liberação das Drogas; Ideologia de Gênero; Limitação da Liberdade Religiosa; Mudança da Pedofilia de Crime para Doença; Ideologia de Gênero, entre outros.
2 – Fim da obrigatoriedade do voto, já que em sua essência trata-se de um direito e não de uma obrigação;
3 – Redução da maioridade penal de 18 para 16 anos, pois se o jovem a partir dos 16 anos tem o direito de votar, de tornar-se emancipado e de abrir uma empresa, deverá também ser responsável criminalmente pelos seus atos, inclusive podendo tirar sua CNH (Carteira Nacional de Habilitação);
4 – Acabar com a progressão de regime e com o regime semiaberto, pois quem recebe uma pena pelo cometimento de um crime deverá cumpri-lo integralmente;
5 – Fim das saidinhas temporárias dos presídios e da visita íntima, pois presídio não é uma colônia de férias;
6 – Privatização dos presídios, pois este modelo tem obtido melhores resultados em todo o mundo;
7- Fim do fundo eleitoral e do tempo gratuito de TV, pois não é justo que em um país com tantas carências na área da educação, da saúde e da segurança pública, que o erário pague as despesas das campanhas eleitorais dos candidatos;
8 –  Audiências públicas visando a Proibição do político com cargo eletivo em matricular seus filhos em escolas particulares, como forma de “incentivo” na melhoria do sistema público de ensino;
9 - Extinção do programa obrigatório “A Voz do Brasil”, justificada por sua baixa audiência, por seu custo e por diversas opções atuais de comunicação;
10 - Entrada única para todas as polícias, tendo sua promoção de acordo com critérios de mérito, de capacitação e de tempo de serviço, desta forma pondo fim ao concurso separado aos cargos de delegado e de oficiais da Polícia Militar;
11 – Criação do piso salarial único da segurança pública, combatendo assim as disparidades entre os estados e os baixos salários;
12 - Privatização de estatais que não sejam de controle estratégico, tais como Correios, Eletrobrás, etc.;
13 - Fim da reeleição para todos os cargos (  executivo e do Legislativo) e mandato de 5 anos;
14 – Revisão da Lei de Licitações (8.666) para reduzir a burocracia e combater a corrupção;
15 – Proibição da doutrinação político-partidária nas escolas instituindo a *ESCOLA SEM PARTIDO*
16 - Revogação do Estatuto do Desarmamento e fim da Lei Rouanet;
17 – Fim das regalias dos servidores públicos eletivos ou concursados, tais como auxilio moradia, auxilio paletó, entre outros;
18 - Revogação dos crimes contra a honra, passando os mesmos somente à tutela do Direito Civil (multa, indenização por danos morais ou materiais, etc.) pois as Polícias, o Judiciário e o Ministério Público deverão priorizar o combate aos crimes que prejudicam a sociedade de forma mais grave. 
19 – Simplificação e redução de impostos, como forma de estimular o comércio, a indústria e o emprego; 
20 - Condicionar o recebimento do Bolsa Família a um curso profissionalizante que, ao final, insira o beneficiário no mercado de trabalho (isso nos casos em que os beneficiários disponham de saúde, de capacidade e de idade apta);
21 - Substituir as cotas raciais  por COTAS SOCIAIS;
22 - Defender a liberdade de imprensa;
23 - Criação de uma Lei Antiterrorismo digna desse nome, a qual enquadre os movimentos ditos “sociais” que promovem a desordem pública e a depredação de propriedade pública e privada;
24 - Apoiar a criação de medidas que combatam a corrupção e estimulem a transparência das contas públicas;
25 – Vinculação do salário do vereador ao piso nacional do professor;
26 – Criação ou efetivação de uma retaguarda jurídica que possibilite aos agentes da segurança pública e ao cidadão comum a atuarem sem medo de uma injusta represália, quando na defesa de sua vida, da vida de outrem ou de seu patrimônio.

27 - Estimular as FFAA a instituirem colégios Militares em parceria com os municípios;
28 - Audiências Públicas pra debater co prpjeto de Castração quimica para estupradores;
29 - PEC para que a composição dos colegiados de Juízes Membros dos TJs e supremas cortes só sejam preenchidos via concurso e com critérios de idoneidade;
30 - Criar instrumentos para que o Exército Brasileiro gerencie as obras públicas que envolvam recursos federais, acompanhando todo o processo.

