Um amigo meu me perguntou se era justo PM aposentar com 30 anos de efetivo serviço e ter promoção ao posto imediato. Aí eu respondi: é uma pergunta até difícil de responder com sim ou não.
Há um contexto imenso a ser levado em consideração .
PM trabalha réveillon, natal, carnaval, eleições, copa do mundo, olimpíadas etc. Enfim, toda vez que se fala em feriado ou evento, nossas folgas são cassadas, enquanto TODO o resto do funcionalismo está de férias, folga ou recesso;
PM via de regra NÃO pode escolher mês que quer tirar férias. Vc faz uma lista tríplice e o comando que escolhe pra Vc, levando em conta o que é melhor para o ESTADO;
PM não tem FGTS; 
PM não tem seguro-desemprego;
PM não pode ter pessoa jurídica, ou seja, nosso regime é de dedicação exclusiva e tempo integral. TEMOS QUE ESTAR A DISPOSIÇÃO DO ESTADO O TEMPO TODO E SÓ PODEMOS SER PM; TODO O RESTO DO FUNCIONALISMO PODE FAZER O QUE QUISER NA SUA FOLGA, NÓS NÃO;
PM não tem direito a sindicalização e greve; 
PM não recebe hora extra, ÚNICO funcionário público que não recebe;
PM não recebe periculosidade, nem insalubridade, mas Oficiais de Justiça recebem. E somos nós que os escoltamos qdo vão intimar os outros em locais insalubres e perigosos. Incoerente né?!;
PM não recebe adicional noturno, e trabalhamos 50% do nosso tempo a noite. Mas TODOS os outros funcionários recebem;
O PM perde sua vida social por 30 anos. E não estamos falando só de 30 anos, mas sim dos 30 anos de sua juventude e maior vida ativa;
Você não pode se dar o luxo de frequentar o lugar que quer e tão pouco ser identificado como policial, sob pena de condenação imediata a morte, por aqueles que muitos dizem ser vítimas das sociedade;
A Grande maioria saem do serviço doentes, sobretudo problemas de coluna pelo peso do armamento/ equipamento e hipertensão pelo do stress continuo, tendo consequentemente uma reduzida expectativa de vida após se aposentar;
Temos de muito longe o maiores índices de suicídio e depressão entre todos os funcionários públicos; 
Então tudo isso tem que ser levado em consideração quando se fala de algum "privilégio" de PMs; 
E só pra não te deixar sem resposta, esses são alguns motivos de achar no mínimo merecido.

