*- O pai policial* é aquele que vê seu filho chorar quando o vê calçando o coturno, mas precisa deixá-lo, pois os filhos dos demais cidadãos também precisam de sua proteção;
*- O pai policial* é aquele que, apesar das ausências, tem em sua família admiradores, embora todos os dias os noticiários acusem generalizadamente sua profissão;
*- O pai policial* é aquele que precisa explicar ao filho que, embora possa precisar matar em sua profissão, é uma pessoa boa, sensível e moderada;
*- O pai policial* é aquele que não conta em casa as ocorrências arriscadas por que passou, mesmo que todos os problemas domésticos lhes sejam lançados à cara;
*- O pai policial* é aquele que até admite represálias contra si mesmo, mas vive com medo de atentarem contra seus filhos e esposa;
*- O pai policial* é aquele que tem que explicar aos filhos que a escola será interrompida, por ter sido transferido de uma cidade para outra por necessidade do trabalho;
*- O pai policial* é aquele que vê cotidianamente filhos de outras pessoas sendo degradados, o que lhe leva a pensar no que vem fazendo para resguardar seu próprio filho;
*- O pai policial* é aquele que geralmente não tem as melhores condições para dar a sua família – as melhores roupas, a melhor moradia, o melhor transporte etc;
*- O pai policial* é aquele que precisa adiar o passeio com os filhos, por causa do serviço extraordinário que surgiu na última hora;
*- O pai policial* é aquele que, após se aposentar, se arrepende de não ter dado a atenção necessária a sua família, mas mesmo assim sente uma falta enorme do seu trabalho.

